export const CHANGE_ORIGIN = 'CHANGE_ORIGIN'
export const changeOrigin = data => ({
    type: CHANGE_ORIGIN,
    data
})

export const CHANGE_NEW = 'CHANGE_NEW'
export const changeNew = data => ({
    type: CHANGE_NEW,
    data
})
